#define NUM_PATTERNS 50

//#define PATTERN(p,i) patterns[(32*int(p)+(i)) % patterns.length()]
#define PATTERN(p,i) texelFetch(pat, ivec2(int(p) % NUM_PATTERNS, i), 0).x

float smnca(vec2 fragCoord, sampler2D ch, sampler2D pat, vec2 R, float t)
{
	float res = texture(ch, fragCoord/R).x;

    const vec2 ring[8] = vec2[](vec2(1,0), vec2(3,0), vec2(2,0), vec2(5,3), vec2(5,2), vec2(9,7), vec2(4,2), vec2(12,9));
	const float dt = .05;

    // neighbourhood averages
    float[8] nhdt;
    float[8] tots;
    for(int r = 0; r < 8; r++) nhdt[r] = tots[r] = 0.;
    for(float i = -12.; i <= 12.; i++) {
        for(float j = -12.; j <= 12.; j++) {
            vec2 ij = vec2(i,j);
            if (ij == vec2(0)) continue;
            for(int r = 0; r < 8; r++) {
                if(ring[r].y + .5 < length(ij) && length(ij) <= ring[r].x + .5) {
                    tots[r]++;
                    nhdt[r] += texture(ch, (fragCoord + ij)/R).x;
                }
            }
        }
    }
    for(int r = 0; r < 8; r++) nhdt[r] /= tots[r];

    // update rules
    float a = smoothstep(.3, .7, fract(t));
    vec4 rslt = vec4(res);
    for(int i = 0; i < 16; i++) {
        float lo = mix(PATTERN(t,2*i),   PATTERN(t+1.,2*i),   a);
        float hi = mix(PATTERN(t,2*i+1), PATTERN(t+1.,2*i+1), a);
        if(lo <= nhdt[i/2] && nhdt[i/2] <= hi)
            rslt[i/4] += dt * (i%2==0 ? 1. : -1.);
    }

    // smoothing
    for(int i = 0; i < 4; i++) rslt[i] += dt * (nhdt[2*i] + nhdt[2*i+1])/2.;
    rslt /= 1. + dt;

    // selection stage
	float res0 = res;
	for(int i = 0; i < 4; i++)
        if(abs(res0 - res) < abs(res0 - rslt[i]))
            res = rslt[i];

    return res;
}



